import React from 'react';
import styled from 'styled-components';
import Link from './Link.js';


const HeaderNav = styled.div`
    width: 1040px;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    position: relative;
    z-index: 2;
    top: -620px;
    a{
        padding: 0 25px;
    }
`

const Logo = styled.div`
    a{
        font-weight: 700;
        font-size: 30px;
    }
`
const NavCenter = styled.div`

`
const NavRight = styled.div`

`

class Header extends React.Component {
  render(){
    return (
        <HeaderNav>
            <Logo>
                <Link text="stripe"/>
            </Logo>
            <NavCenter>
                <Link text="Products"/>
                <Link text="Developers"/>
                <Link text="Company"/>
                <Link text="Pricing"/>
            </NavCenter>
            <NavRight>
                <Link text="Support"/>
                <Link text="Sign in"/>
            </NavRight>
        </HeaderNav>
    );
  }
}
export default Header;
